import React from 'react';
import Link from 'next/link'
import {Button} from 'antd';

const Home = () => {
    return (
    <>
        <div>홈화면</div>
        <Link href="/signup"><Button>회원가입</Button></Link>
        
    </>)
}

export default Home;
